          "description": "<div>\u041e\u043d\u043b\u0430\u0439\u043d \u0441\u0435\u0440\u0432\u0456\u0441, \u0449\u043e \u0434\u043e\u043f\u043e\u043c\u0430\u0433\u0430\u0454 \u0441\u0438\u0441\u0442\u0435\u043c\u0430\u0442\u0438\u0437\u0443\u0432\u0430\u0442\u0438 \u0442\u0430 \u043e\u0440\u0433\u0430\u043d\u0456\u0437\u043e\u0432\u0443\u0432\u0430\u0442\u0438&nbsp;\u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e (\u0442\u0435\u043a\u0441\u0442, \u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f, \u0430\u0443\u0434\u0456\u043e, \u0432\u0456\u0434\u0435\u043e \u0442\u0430 \u0456\u043d.), \u0434\u0456\u043b\u0438\u0442\u0438\u0441\u044f \u0456\u0437 \u0441\u0432\u043e\u0457\u043c\u0438 \u0434\u0440\u0443\u0437\u044f\u043c\u0438.<br><br>\u041e\u0441\u043d\u043e\u0432\u043d\u0435 \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f LivaRava - \u0432\u0438\u0440\u0456\u0448\u0435\u043d\u043d\u044f \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0438 \u043a\u043e\u043c\u0443\u043d\u0456\u043a\u0430\u0446\u0456\u0457 \u0442\u0430 \u043e\u0440\u0433\u0430\u043d\u0456\u0437\u0430\u0446\u0456\u0457 \u043c\u0456\u0436 \u043b\u044e\u0434\u044c\u043c\u0438&nbsp;\u0437\u0430\u0440\u0430\u0434\u0438 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u0433\u0430\u0440\u043c\u043e\u043d\u0456\u0457 \u0442\u0430 \u0431\u0456\u043b\u044c\u0448 \u0434\u043e\u0431\u0440\u043e\u0433\u043e \u043d\u0430\u0432\u043a\u043e\u043b\u0438\u0448\u043d\u044c\u043e\u0433\u043e \u0441\u0432\u0456\u0442\u0443.<br><br>\u0412 LivaRava (\u041d\u0435\u0439\u0440\u043e\u043d\u0435\u0442\u0456) \u0454 \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u0438\u0439 \u0441\u0435\u043a\u0442\u043e\u0440 \u0442\u0430 \u043f\u0443\u0431\u043b\u0456\u0447\u043d\u0438\u0439. \u041f\u0440\u0438\u0432\u0430\u0442\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u0442\u0456\u043b\u044c\u043a\u0438 \u0412\u0430\u043c, \u0442\u0430 \u0442\u0438\u043c \u0456\u0437 \u043a\u0438\u043c \u0412\u0438 \u043f\u043e\u0434\u0456\u043b\u0438\u0442\u0435\u0441\u044c \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0454\u044e. \u041f\u0443\u0431\u043b\u0456\u0447\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u0431\u0443\u0434\u044c-\u044f\u043a\u0438\u043c \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430\u043c, \u043d\u0430\u0432\u0456\u0442\u044c \u0442\u0438\u043c, \u0449\u043e \u043d\u0435\u0437\u0430\u0440\u0435\u0454\u0441\u0442\u0440\u043e\u0432\u0430\u043d\u0456. \u041e\u0441\u043d\u043e\u0432\u043d\u0430 \u0432\u0456\u0434\u043c\u0456\u043d\u043d\u0456\u0441\u0442\u044c LivaRava (\u041d\u0435\u0439\u0440\u043e\u043d\u0435\u0442\u0443) \u0432\u0456\u0434 \u0456\u043d\u0448\u0438\u0445 \u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432, \u0446\u0435 \u0442\u0435, \u0449\u043e \u0432 \u043d\u044c\u043e\u043c\u0443 \u043c\u043e\u0436\u043d\u0430 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u044e\u0432\u0430\u0442\u0438 \u0437\u0432'\u044f\u0437\u043a\u0438 \u043c\u0456\u0436 \u0431\u0443\u0434\u044c-\u044f\u043a\u0438\u043c\u0438 \u0442\u0438\u043f\u0430\u043c\u0438 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457, \u043d\u0430\u0432\u0456\u0442\u044c, \u044f\u043a\u0449\u043e \u0432\u043e\u043d\u0430 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u0432 \u0440\u0456\u0437\u043d\u0438\u0445 \u0456\u043d\u0448\u0438\u0445 \u0441\u0435\u0440\u0432\u0456\u0441\u0430\u0445 (Wikipedia, Youtube, Picasa, Facebook \u0442\u0430 \u0456\u043d.)</div>",
